class FooterNavigator extends HTMLElement {
    constructor() {
        super();
        this.className = "FooterNav";
        console.log(this);
        this.append(this.StyleC);
        this.Options.forEach(element => {
            this.append(WRender.Create(element));
        });
    }
    type = "div";
    StyleC = new WStyledRender({
        ClassList: [
            new WCssClass(".FooterNav", {
                display: "flex",
                "justify-content": " space-between",
                "box-shadow": "0 2px 5px 2px rgba(0,0,0,0.5)",
                overflow: "hidden",
                padding: "10px 30px"
            }),
            new WCssClass(`.FooterNav img`, {
                height: 30,
                width: 30,
                opacity: "0.6"
            })
        ]
    })
    icons = {
        home: "data:image/png;base64,",
        perfil: "data:image/png;base64,",
        foro: "data:image/png;base64,",
        info: "data:image/png;base64,"
    }
    Options = [
        {
            tagName: 'img', src: this.icons.home, onclick: async () => {
                const { HomeView } = await import("./Views/HomeView.js");
                DOMManager.NavigateFunction("HomeClass", new HomeView());
            }
        }, {
            tagName: 'img', src: this.icons.foro, onclick: async () => {
                //----
            }
        }, {
            tagName: 'img', src: this.icons.perfil, onclick: async () => {
                if (!WSecurity.Auth()) {
                    WSecurity.LoginIn();
                    return;
                }
                DOMManager.NavigateFunction("PerfilView", new PerfilView(WSecurity.User()));
            }
        }, {
            tagName: 'img', src: this.icons.info, onclick: async () => {
                //----
            }
        }
    ];
}
customElements.define('w-footer', FooterNavigator);

